# ----------------------------
# 1. |Φ⁺⟩ = (|00⟩ + |11⟩)/√2 == CORRELATED 00 11
# ----------------------------

# Create a circuit with 2 qubits and 2 classical bits
qc_phi_plus = QuantumCircuit(2, 2)

# Step 1: Apply Hadamard to qubit 0 to create superposition
qc_phi_plus.h(0)  # (|0⟩ + |1⟩)/√2

# Step 2: Apply CNOT - control: qubit 0, target: qubit 1. if qubit 0 = 0 qubit 1 = qubit 1. if qubit 0 = 1, qubit 1 flips
qc_phi_plus.cx(0, 1)  # entangles |0⟩ with |0⟩ and |1⟩ with |1⟩

# Step 3: Measure both qubits
qc_phi_plus.measure([0, 1], [0, 1])

# Simulate and visualize
simulate_bell(qc_phi_plus, title="Bell State |Φ⁺⟩ = (|00⟩ + |11⟩)/√2")

# Visualize circuit
qc_phi_plus.draw(output='mpl')

