# ----------------------------
# Bell State |Ψ⁺⟩ = (|01⟩ + |10⟩)/√2  == ANTICORRELATED 01 10
# ----------------------------

qc_psi_plus = QuantumCircuit(2, 2)

# Step 1: Flip qubit 1 to |1⟩ instead of |0⟩
qc_psi_plus.x(1)

# Step 2: Apply Hadamard to qubit 0
qc_psi_plus.h(0)

# Step 3: Entangle with CNOT
qc_psi_plus.cx(0, 1)

# Step 4: Measure both
qc_psi_plus.measure([0, 1], [0, 1])

# Simulate and visualize
simulate_bell(qc_psi_plus, title="Bell State |Ψ⁺⟩ = (|01⟩ + |10⟩)/√2")

# View circuit
qc_psi_plus.draw(output='mpl')

