# ----------------------------
# Bell State |Ψ-⟩ = ​(∣01⟩−∣10⟩)/√2  == Flipped

# ----------------------------

qc_psi_minus = QuantumCircuit(2, 2)

# Step 1: Flip qubit 1 to |1⟩ instead of |0⟩
qc_psi_minus.x(1)

# Step 2: Apply Hadamard to qubit 0
qc_psi_minus.h(0)

# Step 3: Entangle with CNOT
qc_psi_minus.cx(0, 1)

# Step 4: Z gate to flip the signal
qc_psi_minus.z(1)

# Step 5: Measure both
qc_psi_minus.measure([0, 1], [0, 1])

# Simulate and visualize
simulate_bell(qc_psi_minus, title="Bell State |Ψ-⟩ = (|01⟩ + |10⟩)/√2")

# View circuit
qc_psi_minus.draw(output='mpl')

from qiskit import QuantumCircuit
from qiskit.quantum_info import Statevector
from qiskit.visualization.bloch import Bloch
import matplotlib.pyplot as plt
import numpy as np

def bloch_vector(state_vector):
    alpha = state_vector[0]
    beta = state_vector[1]
    theta = 2 * np.arccos(np.abs(alpha))
    phi = np.angle(beta) - np.angle(alpha)
    x = np.sin(theta) * np.cos(phi)
    y = np.sin(theta) * np.sin(phi)
    z = np.cos(theta)
    return [x, y, z]

# Initial state |+> = (|0> + |1>)/sqrt(2)
state = Statevector.from_label('+')

# Circuits to apply X and Z gates
qc_x = QuantumCircuit(1)
qc_x.x(0)

qc_z = QuantumCircuit(1)
qc_z.z(0)

# Evolve states
state_x = state.evolve(qc_x)
state_z = state.evolve(qc_z)

# Create Bloch spheres
bloch_initial = Bloch()
bloch_initial.add_vectors([bloch_vector(state.data)])

bloch_x = Bloch()
bloch_x.add_vectors([bloch_vector(state_x.data)])

bloch_z = Bloch()
bloch_z.add_vectors([bloch_vector(state_z.data)])

# Plot all three Bloch spheres side by side
fig, axes = plt.subplots(1, 3, figsize=(15, 5))

for bloch, ax, title in zip(
    [bloch_initial, bloch_x, bloch_z],
    axes,
    ['Initial |+> state', 'After X gate', 'After Z gate']
):
    bloch.render(ax)
    ax.set_title(title)

plt.tight_layout()
plt.show()

############ VISUALIZE GATES IMPACT  ###############

import io
from PIL import Image

def bloch_vector(state_vector):
    alpha = state_vector[0]
    beta = state_vector[1]
    theta = 2 * np.arccos(np.abs(alpha))
    phi = np.angle(beta) - np.angle(alpha)
    x = np.sin(theta) * np.cos(phi)
    y = np.sin(theta) * np.sin(phi)
    z = np.cos(theta)
    return [x, y, z]

# Gates dict
gates = {
    'Identity (Initial)': QuantumCircuit(1),
    'X Gate': QuantumCircuit(1),
    'Y Gate': QuantumCircuit(1),
    'Z Gate': QuantumCircuit(1),
    'Hadamard (H) Gate': QuantumCircuit(1),
}

gates['X Gate'].x(0)
gates['Y Gate'].y(0)
gates['Z Gate'].z(0)
gates['Hadamard (H) Gate'].h(0)

initial_state = Statevector.from_label('0')

images = []
titles = []

for name, qc in gates.items():
    evolved_state = initial_state.evolve(qc)
    fig = plot_bloch_multivector(evolved_state.data)
    buf = io.BytesIO()
    fig.savefig(buf)
    buf.seek(0)
    images.append(Image.open(buf))
    titles.append(name)
    plt.close(fig)

# Now plot images side by side
fig, axes = plt.subplots(1, len(images), figsize=(4*len(images), 4))
for ax, img, title in zip(axes, images, titles):
    ax.imshow(img)
    ax.axis('off')
    ax.set_title(title)

plt.show()

import ipywidgets as widgets
from IPython.display import display

def plot_gate(gate_name):
    qc = gates[gate_name]
    evolved = initial_state.evolve(qc)

    # Plot Bloch vector and save to buffer
    fig = plot_bloch_multivector(evolved.data)
    buf = io.BytesIO()
    fig.savefig(buf, format='png')
    buf.seek(0)
    img = Image.open(buf)
    plt.close(fig)  # Close the original matplotlib figure to avoid duplicates

    # Show the saved Bloch image
    fig, ax = plt.subplots(figsize=(4, 4))
    ax.imshow(img)
    ax.axis('off')
    ax.set_title(gate_name)
    plt.show()

    # Show the quantum circuit
    display(qc.draw(output='mpl'))

widgets.interact(plot_gate, gate_name=list(gates.keys()));